    "Input.html": {
      "id": "Input.html",
      "kind": "class",
      "title": "Input",
      "longname": "Input",
      "name": "Input",
      "tags": "Input",
      "summary": "",
      "description": "The Input class represents a MIDI input port. This object is derived from the host's MIDI subsystem and cannot be instantiated directly. You can find a list of all available Input objects in the WebMidi#inputs array. The Input class extends the EventEmitter class from the djipevents module. This means it also includes methods such as getListeners(), emit(), suspendEvent() and several others. The addListener(), addOneTimeListener(), hasListener() and removeListener() methods are being overridden in this class to include a channel parameter which makes it possible to add/remove listeners from several channels at once. Note that, when adding events to channels, it is the InputChannel instance that gets a listener added and not the Input instance. Also note that several events are input-wide and not tied to a channel. Examples of these are \"opened\", \"midimessage\", \"sysex\", etc. In such cases, simply pass undefined as the channel parameter.",
      "body": ""
    },
